import React, { Component } from 'react';

class Lottery extends Component {
  constructor(props) {
    super(props);
    console.log(this.props.randNum);
  }

  render() {
    return (
      <div>
        <h1> {this.props.title} </h1>
        <p> {this.props.numbers} </p>
        <h2>Lottery Component</h2>
      </div>
    );
  }
}

export default Lottery;
